webpackJsonp([0x7a30cd60afc0],{6572:function(e,s){e.exports={data:{post:{html:'<p>Doc Searls describes his <a title="The Doc Searls Weblog : Saturday, December 20, 2003" href="http://doc.weblogs.com/2003/12/23#theBestChristmasGiftsAnyCoffeeFreakCanGetOrGive">Starbucks Barista espresso machine</a>. It\'s his third machine, list price $399, 2 year guarantee, and "if you use it heavily it should last at least that long". We have a 10 year old Bosch Espresso Cup (mostly plastic, cost DM 99 at the time) and a &#8364;1.99 milk frother. And we buy pre-ground espresso from our discounter. What are we missing?</p>',fields:{title:"Espresso Love",date:"24 Dec 2003",url:"https://papascott.de/2003-12-24-espresso-love/"}}},pathContext:{slug:"/2003-12-24-espresso-love/",prev:{fields:{title:"Speech Therapy",date:"23 Dec 2003",slug:"/2003-12-23-speech-therapy/"}},next:{fields:{title:"Santa Has Landed",date:"24 Dec 2003",slug:"/2003-12-24-santa-has-landed/"}}}}}});
